import { Component } from '@angular/core';
import {LoggingService} from "../logging.service";

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {
  constructor(private logSer: LoggingService) {
  }

  public log(){
    console.log(this.logSer.title)
    this.logSer.log("This is Home")
  }
  public onChange(e: Event){
    this.logSer.title = (e.target as HTMLInputElement).value;
  }

}
<p class="alert alert-success" style="text-align: center;">We are in Home component</p>
<input type="text" (input)="onChange($event)">
